import base64
from PyQt5.QtGui import QIcon, QPixmap

# Base64 encoded icon data
ICON_DATA = {
    'folder': '',
    'user': "",
    'file-text': '',
    'file': '',
    'folder-plus': '',
    'user-plus': '',
    'file-plus': '',
    'upload': '',
    'cloud-upload': '',
    'home': '',
    'search': '',
    'logo': ""
}

def get_icon(name):
    if name not in ICON_DATA:
        return QIcon()
    
    pixmap = QPixmap()
    pixmap.loadFromData(base64.b64decode(ICON_DATA[name]))
    return QIcon(pixmap)
